function AllInfoUser() {
const dados = useContext(InfosContext)
console.log(dados)
    return (
      <Box bgcolor = '#1F1F1F' height = '126px' color ='white'>
        <p>#{dados.login&&dados.allInfo.login}</p>
      </Box>
    );
  }
  
  export default AllInfoUser;
